INSERT INTO wp_wb_stn_notes VALUES("1", "\n			\n			\n			registering ( first step )&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;profile for, dob, language, gender, email ----&gt;&nbsp; &nbsp; otp and set_password&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;CODING&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;from front page&nbsp;&lt;/div&gt;&lt;div&gt;we have to add subscriber user through form submit,&nbsp;&lt;/div&gt;&lt;div&gt;then connect it with metafields of that subscriber&nbsp;&lt;/div&gt;&lt;div&gt;and sent OTP to the given email&nbsp;&lt;/div&gt;&lt;div&gt;and proceed to next page ( OTP page )&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;then comes to ----|&lt;/div&gt;&lt;div&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\\\\|/&nbsp;&nbsp;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; profiles page&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;---------------------------------------------------------------------&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;elementor form is not accepting admin-post.php form&nbsp;&lt;/div&gt;&lt;div&gt;we will have to use html form only&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;						", "1", "1", "0", "10000013", "0", "16", "0", "620", "529", "166", "280");
INSERT INTO wp_wb_stn_notes VALUES("2", "IN PROFILES ( subscriber metafields )&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;1&nbsp; user_id&nbsp; &nbsp;&lt;/div&gt;&lt;div&gt;2&nbsp; profile_for&lt;/div&gt;&lt;div&gt;3&nbsp; dob&lt;/div&gt;&lt;div&gt;4&nbsp; language&lt;/div&gt;&lt;div&gt;5&nbsp; gender&lt;/div&gt;&lt;div&gt;6&nbsp; --email---&lt;/div&gt;&lt;div&gt;7&nbsp; --password---&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;8&nbsp; &nbsp; first-name&lt;/div&gt;&lt;div&gt;9&nbsp; &nbsp; second-name&lt;/div&gt;&lt;div&gt;10&nbsp; highest-qualification&lt;/div&gt;&lt;div&gt;11&nbsp; select-height&lt;/div&gt;&lt;div&gt;12&nbsp; select-weight&lt;/div&gt;&lt;div&gt;13&nbsp; location-country&lt;/div&gt;&lt;div&gt;14&nbsp; location-state&lt;/div&gt;&lt;div&gt;15&nbsp; location-city&lt;/div&gt;&lt;div&gt;16&nbsp; occupation&lt;/div&gt;&lt;div&gt;18&nbsp; hobbies&lt;/div&gt;&lt;div&gt;19&nbsp; about-me&lt;/div&gt;&lt;div&gt;20&nbsp; whatsapp-number&lt;/div&gt;&lt;div&gt;21&nbsp; baptized&lt;/div&gt;&lt;div&gt;22&nbsp; pics ( featured-image, image-gallery )&lt;/div&gt;", "1", "1", "0", "10000012", "4", "16", "0", "478", "568", "106", "948");
